import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import styled from "styled-components";
import MainPage from "./chapter_16_mini_blog/component/page/MainPage";
import PostWritePage from "./chapter_16_mini_blog/component/page/PostWritePage";
import PostViewPage from "./chapter_16_mini_blog/component/page/PostViewPage";

const MainTitleText = styled.p`
    font-size: 24px;
    font-weight: bold;
    text-align: center;
`;

function App(props) {
    return (
        <BrowserRouter>
            <MainTitleText>소플의 미니 블로그</MainTitleText>
            <Routes>
                <Route index element={<MainPage />} />
                {/*<Route path="post-write" element={<PostWritePage />} />*/}
                <Route path="post/:postId" element={<PostViewPage />} />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
